import { Container, TextField } from "@mui/material";
import React from "react";
import Box from "@mui/material/Box";
import Story from "./Story";
import Avatar from "@mui/material/Avatar";


function Feed() {
  return (
    <div>
      <Container maxWidth="sm">
        <Box
          sx={{
            width: 600,
            height: 350,
          }}
        >
          <Story sx={{ marginTop: "80px" }} />
        </Box>
        <Container sx={{
          width: 450,
          height: 60,
            textAlign: "center",
            background: "white",
            border: 0 ,
            boxShadow: "1px 1px 2px 1px #ccc",
            margin: 4,
            marginTop: "0%"
          }}  >
        <Box  >

        <Avatar sx={{
          height: 35,
          width: 35,
            textAlign: "center",
            border: 0 ,
            boxShadow: "1px 1px 2px 1px #ccc",
            margin: 1
          }} />

         <TextField type="text" placeholder="Add post.."  sk={{ 
           border:0,
          background: "whitesmoke"
           }} />

        </Box>
        </Container >
        <Box
          
        />
         <Box
          sx={{
            width: 600,
            height: 300,
            background: "white",
            border: 0 ,
            margin: 4,
            marginLeft: "-40px",
            boxShadow: "1px 1px 2px 1px #ccc"

          }}
        />
      </Container>
    
    </div>
  );
}

export default Feed;
